import "./about.css";

export default function about() {
  return (
    <div className="about">
      <label className="contentImage">ProfileImage</label>

      <input
        type="text"
        className="contentName"
        placeholder="Name etc.."
      ></input>

      <input
        type="text"
        className="contentInform"
        placeholder="Carrer etc.."
      ></input>
    </div>
  );
}
